### YamlMime:QSharpType
uid: microsoft.quantum.core.rangeend
name: RangeEnd
type: function
namespace: microsoft.quantum.core
summary: Возвращает определенное конечное значение заданного диапазона, которое не обязательно является последним элементом последовательности.
remarks: >-
  Первым элементом выражения диапазона является `start` , второй элемент —, `start+step` третий элемент — и `start+step+step` т. д., пока `end` не будет передан.


  Обратите внимание, что определенное конечное значение диапазона может отличаться от последнего элемента последовательности, заданной диапазоном. Например, в диапазоне 0.. 2.. 5 последний элемент — 4, а конечное значение — 5.
syntax: 'function RangeEnd (range : Range) : Int'
input:
  content: '(range : Range)'
  types:
  - name: range
    isPrimitive: true
    uid: Range
output:
  content: Int
  types:
  - summary: Определенное конечное значение заданного диапазона.
    isPrimitive: true
    uid: Int
